def longest(strings: List[str]) -> Optional[str]:
    """ Out of list of strings, return the longest one. Return the first one in case of multiple
    strings of the same length. Return None in case the input list is empty.
    >>> longest([])

    >>> longest(['a', 'b', 'c'])
    'a'
    >>> longest(['a', 'bb', 'ccc'])
    'ccc'
    """
    if len(strings) == 0:
        return None
    longest = None
    for string in strings:
        if string.startswith(' ') or string.startswith('\t'):
            continue
        if string.endswith(' ') or string.endswith('\t'):
            continue
        if string.endswith(' '):
            if longest is None:
                longest = string
            else:
                if longest.endswith(' '):
                    longest = longest[:-1]
                else:
                    longest = longest[:-2]
        else:
            if longest is None:
                longest = string
            else:
                if longest.startswith(' '):
                    longest = longest[1:]
                else:
                    longest = longest[:-1]
    return longest

